import React from 'react';

class Input extends React.Component {
	constructor(props) {
		super(props);
	}


	renderInput() {
		if(this.state.isSecond === false) {
			return <input type="text" value={this.props.valueone} />;
		}
		else {
			return <input type="text" value={this.props.valueone} />;
		}
	}

	render() {
		return (
			<div>
				<form className="ui form">
					<div className="field">
						{this.renderInput()}
					</div>
				</form>
			</div>
		);
	}
}

export default Input;
